		public StructRegCollection getRegCollection(string denom)
		{
			foreach (StructRegCollection coll in catalogue)
			{
				if (string.Compare(coll.regionTitle, denom, true) == 0)
					return coll;
			}

			return null;
		}


		public StructProperties.StructBaseProperties getCatProperties(string denom)
		{
			int icounter, temp;

			for(icounter = 0; icounter < denom.Length; icounter++)
				if(int.TryParse(denom[icounter].ToString(),out temp))
					break;

			return getCatProperties(denom.Substring(0,icounter),denom);
		}

		public StructProperties.StructBaseProperties getCatProperties(string type, string denom)
		{
			string region = null;
			if (string.Compare(type, "ub", true) == 0 || string.Compare(type, "uc", true) == 0 || string.Compare(type, "uc", true) == 0)
				region = "British";
			if (string.Compare(type, "hd", true) == 0 || string.Compare(type, "he", true) == 0 || string.Compare(type, "hl", true) == 0 || string.Compare(type, "hl", true) == 0 || string.Compare(type, "ipe", true) == 0)
				region = "EuroProfile";
			if (type.Length > 2)
				if (string.Compare(type.Substring(0, 3), "ipe", true) == 0)
					region = "EuroProfile";
			if (string.Compare(type, "aub", true) == 0 || string.Compare(type, "auc", true) == 0 || string.Compare(type, "awb", true) == 0 || string.Compare(type, "awc", true) == 0 )
				region = "Australian";

			if (region == null)
			{
				if (string.Compare(type, "SHS", true) == 0)
				{
					return (new StructProperties.StructRHSProperties(denom));
				}
				if (string.Compare(type, "RHS", true) == 0)
				{
					return (new StructProperties.StructRHSProperties(denom));
				}
				if (string.Compare(type, "CHS", true) == 0)
				{
					return (new StructProperties.StructCHSProperties(denom));
				}
				if (string.Compare(type, "EA", true) == 0)
				{
					return (new StructProperties.StructAngleProperties(denom));
				}

				return null;
			}


			StructRegCollection regColl = getRegCollection(region);
			return regColl.getCatProperties(type, denom);
		}


	}

	public class StructRegCollection
	{
		public StructPropCollection[] profileList;
		private string strTitle;
		int isize = 0;

		public StructRegCollection(string Denom)
		{
			regionTitle = Denom;
		}

		public string regionTitle
		{
			get
			{
				return strTitle;
			}
			set
			{
				strTitle = value;
			}
		}
		public bool add(StructPropCollection SectionCollection)
		{

			StructPropCollection[] temp = new StructPropCollection[isize + 1];
			if (isize > 0)
				Array.Copy(profileList, temp, isize);
			profileList = temp;
			profileList[isize++] = SectionCollection;
			return true;
		}

		public StructPropCollection getProfileColl(string strType)
		{
			foreach (StructPropCollection profile in profileList)
			{
				if (string.Compare(profile.typeTitle, strType, true) == 0)
					return profile;
			}

			return null;


		}

        internal StructProperties.StructBaseProperties getCatProperties(string type, string denom)
		{
			string abrevType = type;
			if (abrevType.Length > 2)
				if (abrevType.Substring(0, 3) == "IPE")
					abrevType = "IPE";
			foreach (StructPropCollection propColl in profileList)
			{
				if (string.Compare(propColl.abrev, abrevType, true) == 0)
					return propColl.getSructProps(denom);
			}

			return null;
		}

	}


	public class StructPropCollection
	{
		private string strTitle;
		public string abrev;
		public StructProperties.StructBaseProperties[] sectLib;
		int isize = 0;

		public string typeTitle
		{
			get
			{
				return strTitle;
			}
			set
			{
				strTitle = value;
			}
		}

		public StructPropCollection(string title, string Abrev)
		{
			strTitle = title;
			abrev = Abrev;
		}

		protected internal bool add(StructProperties.StructBaseProperties StructSect)
		{
			StructProperties.StructBaseProperties[] temp = new StructProperties.StructBaseProperties[isize + 1];
			if (isize > 0)
				Array.Copy(sectLib, temp, isize);
			sectLib = temp;
			sectLib[isize++] = StructSect;
			return true;
		}

		protected internal StructProperties.StructBaseProperties getSructProps(string title)
		{
            for(int icounter = 0; icounter < sectLib.Length; icounter++)
			//foreach (StructProperties.StructBaseProperties sp in sectLib)
			{
                if (icounter == 43)
                    icounter=43;
                StructProperties.StructBaseProperties sp = sectLib[icounter];
				if (string.Compare(sp.Title, title, true) == 0)
					return sp;
			}

			return null;
		}

	}
